  }

  return (
    <>
      <Switch>
        <Route exact path="/" component={Login} />
        <Route exact path="/login" component={Login} />
        <PrivateRoute exact path="/home" component={Main} />

        <Route exact path="/unauthorized" component={Unauthorized} />
      </Switch>
    </>
  );
}

export default App;
